import React from "react";
import { Alert } from "./Alert";
import { Greeting } from "./Greeting";
import { ShoppingCart } from "./ShoppingCart";
import items from "./items";
import moreItems from "./moreItems";
//we need to itendify the file type or it will try and look for a js file, which is the automatic behavior of react
import logo from "./logo.svg";
import "./App.css";

function App() {
  console.log(logo);
  return (
    <div>
      <Alert variant="success">
        <h1>Welcome Back!</h1>
      </Alert>
      <Alert variant="error">
        <h1>Oh NOOO DANGER!</h1>
      </Alert>
      <Greeting />
      <img src={logo} id="logo" />
      <ShoppingCart items={items} userName="Carly" />
      <ShoppingCart items={moreItems} userName="Rusty" />
    </div>
  );
}

export default App;
